  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './webpages/home';
import tracker from './webpages/tracker';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
